import Vue from 'vue';
import VeeValidate from 'vee-validate';
import Notifications from 'vue-notification';
import VueClipboard from 'vue-clipboard2';
import VueCarousel from 'vue-carousel';
import App from './App.vue';
import MainPlugin from './plugins/main'; // import DashboardPlugin from './material-dashboard'

import * as filters from './core/helpers/filters';
import initGlobalDirectives from '@core/vue/directives';
import router from './core/router';
import store from './core/store';
import '../uikit';
import validationMessagesVi from 'vee-validate/dist/locale/vi';
Vue.use(VueClipboard);
Vue.use(VeeValidate, {
  locale: 'vi',
  dictionary: {
    vi: validationMessagesVi
  }
});
Vue.use(Notifications);
Vue.use(MainPlugin);
Vue.use(VueCarousel); // Vue.use(DashboardPlugin)

initGlobalDirectives();
VeeValidate.Validator.extend('username', {
  getMessage: function getMessage() {
    return "T\xE0i kho\u1EA3n ch\u1EC9 ch\u1EE9a s\u1ED1 v\xE0 ch\u1EEF c\xE1i";
  },
  validate: function validate(value) {
    var regex = new RegExp(/^[a-zA-Z0-9]{4,36}$/);
    return regex.test(value);
  }
});
VeeValidate.Validator.extend('phone', {
  getMessage: function getMessage() {
    return "Nh\u1EADp s\u1ED1 \u0111i\u1EC7n tho\u1EA1i t\u1EEB 10 \u0111\u1EBFn 11 ch\u1EEF s\u1ED1, b\u1EAFt \u0111\u1EA7u b\u1EB1ng 0,84 ho\u1EB7c +84";
  },
  validate: function validate(value) {
    var regex = new RegExp(/^(0|84|\+84)([0-9]{9})$/);
    return regex.test(value);
  }
});
new Vue({
  router: router,
  store: store,
  render: function render(h) {
    return h(App);
  }
}).$mount('#app'); // Register global utility filters.

Object.keys(filters).forEach(function (key) {
  Vue.filter(key, filters[key]);
});
